		function tick() { 
			
			if (photonFired) {
				
				if (photon.x > electron.x) {
					
					if (photon.exiteAtom > 0) {
					photon.visible = false;
					moveElectron(photon.exiteAtom );
					}
		
					console.log(photon.wavelength);
					photonFired = false;
				}
		
			}
		}
		
		
		
		
